import React, { useState, useEffect, createContext, useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import all your page components
import HomePage from './components/HomePage';
import Login from './components/Login';
import Signup from './components/Signup';
import HealthAssessment from './components/HealthAssessment';
import Dashboard from './components/Dashboard';
import MapPage from './components/MapPage';
import HealthReport from './components/HealthReport';
import FamilyPage from './components/FamilyPage';
import AdminDashboard from './components/AdminDashboard';
import AdminLogin from './components/AdminLogin';

// --- Session Manager for REGULAR USERS ---
const SessionManager = {
  isLoggedIn: () => !!localStorage.getItem('user'),
  getCurrentUser: () => {
    try {
      return JSON.parse(localStorage.getItem('user'));
    } catch {
      return null;
    }
  },
  // ... your other session manager functions for login/logout
};

// --- Auth Context (for regular users) ---
const AuthContext = createContext();
export const useAuth = () => useContext(AuthContext);

// --- Protected Route for REGULAR USERS ---
const ProtectedRoute = ({ children }) => {
  return SessionManager.isLoggedIn() ? children : <Navigate to="/login" replace />;
};

// --- CORRECTED: Protected Route for ADMINS ---
// This component ensures only a logged-in admin can see the admin dashboard.
const ProtectedAdminRoute = ({ children }) => {
    const isAdminLoggedIn = !!localStorage.getItem('admin_user');
    return isAdminLoggedIn ? children : <Navigate to="/admin-login" replace />;
};

function App() {
  const [user, setUser] = useState(SessionManager.getCurrentUser());

  const authValue = {
    user,
    login: (userData) => { /* ... login logic ... */ setUser(userData); },
    logout: () => { /* ... logout logic ... */ setUser(null); },
  };

  return (
    <AuthContext.Provider value={authValue}>
      <Router>
        <div className="App">
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<HomePage />} />
            <Route path="/map" element={<MapPage />} />

            {/* Regular User Auth Routes */}
            <Route path="/login" element={user ? <Navigate to="/dashboard" /> : <Login />} />
            <Route path="/signup" element={user ? <Navigate to="/dashboard" /> : <Signup />} />

            {/* Regular User Protected Routes */}
            <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
            <Route path="/health-assessment" element={<ProtectedRoute><HealthAssessment /></ProtectedRoute>} />
            <Route path="/health-report" element={<ProtectedRoute><HealthReport /></ProtectedRoute>} />
            <Route path="/add-family" element={<ProtectedRoute><FamilyPage /></ProtectedRoute>} />

            {/* --- CORRECTED: Admin Routes --- */}
            <Route path="/admin-login" element={<AdminLogin />} />
            <Route 
              path="/admin-dashboard" 
              element={
                <ProtectedAdminRoute>
                  <AdminDashboard />
                </ProtectedAdminRoute>
              } 
            />

            {/* Catch-all route to redirect unknown paths */}
            <Route path="*" element={<Navigate to="/" />} />
          </Routes>
        </div>
      </Router>
    </AuthContext.Provider>
  );
}

export default App;
